# Italian
# Questo √® un semplice script di configurazione di nftables per il file nftables.conf (/etc/nftables.conf).
# In questa versione, IPv6 √® bloccato. Puoi modificare lo script per accettare connessioni in ingresso dalla tua rete locale o da un indirizzo IP su Internet ‚Äî ad esempio per gestire la tua macchina tramite SSH.
