# In ogni caso, sei l‚Äôunico responsabile dell‚Äôuso di questo script e, usandolo, accetti tutte le eventuali conseguenze.

# –ú–Ω–µ –Ω–∞–¥–æ–µ–ª–∞ –∏–Ω—Ñ–æ—Ä–º–∞—Ç–∏–∫–∞, –æ–Ω–∞ –º–µ–Ω—è –±–æ–ª—å—à–µ –Ω–µ –∏–Ω—Ç–µ—Ä–µ—Å—É–µ—Ç. –û—Ç—Å—Ç–∞–Ω—å—Ç–µ –æ—Ç –º–µ–Ω—è —Å —ç—Ç–æ–π —á–µ–ø—É—Ö–æ–π.
# –ú–µ–Ω—ñ –Ω–∞–±—Ä–∏–¥–ª–∞ —ñ–Ω—Ñ–æ—Ä–º–∞—Ç–∏–∫–∞, –≤–æ–Ω–∞ –º–µ–Ω–µ –±—ñ–ª—å—à–µ –Ω–µ —Ü—ñ–∫–∞–≤–∏—Ç—å. –í—ñ–¥—á–µ–ø—ñ—Ç—å—Å—è –≤—ñ–¥ –º–µ–Ω–µ –∑ —Ü–∏–º–∏ –¥—É—Ä–Ω–∏—Ü—è–º–∏.
# Ich habe genug von der Informatik, sie interessiert mich nicht mehr. Lasst mich mit diesem Bl√∂dsinn in Ruhe.
# Mam dosƒá informatiki, nje zajimuje mje wjace. Dajƒáe mi z tymi g≈Çuposƒáemi pokoj.
# Mam dosƒá informatiki, nje zajmujo mƒõ wƒõcej. Daj≈õo mƒõ z to≈õ tymi g≈Çuposƒáami spokoj.
#********************

flush ruleset

table inet filter {

               chain input {
               type filter hook input priority 0; policy drop;
               tcp dport 27163 ip saddr 192.168.1.000 drop
               udp dport 27163 ip saddr 192.168.1.000 drop
               iif "lo" accept
               ct state established,related accept
               icmp type echo-request accept
               icmp type time-exceeded drop
   }

chain forward {
               type filter hook forward priority 0; policy drop;
       }

       chain output {
               type filter hook output priority 0; policy accept;
       }
}

table ip6 filter {
       chain input {
               type filter hook input priority 0; policy drop;
               iif "lo" accept
               ct state established,related drop
               icmpv6 type echo-request accept
               icmpv6 type packet-too-big drop
               icmpv6 type time-exceeded drop
               icmpv6 type nd-neighbor-solicit drop
               icmpv6 type nd-neighbor-advert drop
               icmpv6 type nd-redirect drop
               icmpv6 type nd-router-solicit drop
       }

       chain forward {
               type filter hook forward priority 0; policy drop;
       }

      chain output {
               type filter hook output priority 0; policy accept;
       }
}
